import { Container, Stack, Box, Typography, TextField, Button, styled } from '@mui/material';
import React, { useState } from 'react';
import { useSearchParams } from 'react-router-dom';

const Header = (props) => (
    <Box sx={{ 
        position: "absolute", 
        backdropFilter: "blur(10px)", 
        padding: "10px", 
        backgroundColor: "rgba(225, 225, 225, 0.5)", 
        boxShadow: "-4px 9px 25px -6px rgba(0, 0, 0, 0.2)" 
    }}>
        {props.children}
    </Box>
);

const StyledHeader = styled(Header)();

const Query = () => {
  let [searchParams, _] = useSearchParams();
    return (
        <Box sx={{ display: "flex" }} >
            <Box sx={{ p: 0, width: "20vw", height: "100vw", borderRight: "1px solid #dedede"}}>
                <StyledHeader sx={{ width: "20vw" }}>Repositories</StyledHeader>
                aaa
            </Box>
            <Box sx={{ display: "flex", width: "80vw", height: "100vw", borderRight: "1px solid #dedede" }}>
                <Header sx={{ width: "80vw" }}>
                    Query <b>{searchParams.get("repo")}</b>
                </Header>
                <Container sx={{ width: "55vw", height: "100vw" }}>
                    aaa
                </Container>
                <Container sx={{ width: "25vw", height: "100vw" }}>
                    aaa
                </Container>
            </Box>
        </Box>
    );
}

export default Query;
